import React from "react";
import { Page } from "../components/Page";

export function Sponsor() {
  return (
    <Page center={true}>
      <div className="title">
        <div className="heading-1">Sponsor</div>
      </div>
      <div className="sponsor-container">
        <div className="sponsor-item"></div>
      </div>
    </Page>
  );
}
